          height: 56
        }}
        linearGradientProps={null}
        loadingStyle={{}}
        onPress={() => alert("click")}
        title="Click me"
      /> */}
      <View style={{ position: "relative", alignItems: "center" }}>
        <Text >{clickCount}</Text>
      </View>
      <StatusBar style="auto" />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    padding: 15
  },
  lableText: {
    fontSize: 16
  },
  clickButton: {
    backgroundColor: '#FFA978',
    height: 56,
    borderRadius: 8,
    justifyContent: 'center',
    alignItems: 'center',
    color: '#fff'
  }
});
